import React from "react";
import { Link } from "react-router-dom";

const Home = ({ shows }) => {
  return (
    <div>
      <h1>TV Shows</h1>
      {shows.map((show) => {
        return (
          <div key={show.id}>
            {show.image?.medium && (
              <img src={show.image.medium} alt={`Imag of ${show.name}`} />
            )}
            <h2>{show.name}</h2>
            <p>{show.summary}</p>
            <Link to={`/show/${show.id}`}>Show Details</Link>
          </div>
        );
      })}
    </div>
  );
};

export default Home;
